func (_UpKeeping *UpKeepingFilterer) ParsePay(log types.Log) (*UpKeepingPay, error) {
	event := new(UpKeepingPay)
	if err := _UpKeeping.contract.UnpackLog(event, "Pay", log); err != nil {
		return nil, err
	}
	return event, nil
}
